  bmlfonValidateFormData() {
    let pbFlag = true;
    let pbSelectedRow = false;
    this.mArrGrid.forEach(ele => {
      if (ele.Sel) {
        pbSelectedRow = true;
        return;
      }
    });
    /* Abhay/06-July-2020/Bug# 140980,141460 */
    if (!_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_3__.CustomValidator.bmgfCompareTwoDates(this.mdtApplyDate, new Date())) {
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key14'));
      pbFlag = false;
    } else if (!_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_3__.CustomValidator.bmgfCompareTwoDates(this.mdtReceiptDate, this.mdtApplyDate)) {
      if (this.mObjModel.OptionReceipt == true) {
        this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key12'));
        pbFlag = false;
      } else {
        this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key13'));
        pbFlag = false;
      }
    } else if (!pbSelectedRow) {
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key10'));
      pbFlag = false;
    } else if (this.mObjModel.Vend_CustKey == "") {
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key'));
      document.getElementById('txtVendorCustomer').focus();
      pbFlag = false;
    } else if (this.mObjModel.CurrencyKey == "") {
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key1'));
      document.getElementById('txtCurrencyKey').focus();
      pbFlag = false;
    } else if (this.mArrGrid.length == 0) {
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key8'));
      pbFlag = false;
    } else if (this.mObjModel.TotalAppliedAmount > this.mObjModel.RemainingAmount) {
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key9'));
      pbFlag = false;
    } else if (this.mArrGrid.length > 0) {
      this.mArrGrid.forEach(ele => {
        if (ele.WriteOff > 0 && this.mObjModel.BatchSeries == "") {
          this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key5'));
          document.getElementById('txtBatchSeries').focus();
          pbFlag = false;
          return;
        } else if (ele.WriteOff + ele.ApplyAmount > ele.RemAmount) {
          this.objToastService.notifyError(this.appUtility.bmgfonTranslate('ApplyReceipt.Msg.Key11'));
          pbFlag = false;
          return;
        }
      });
    }
    return pbFlag;
  }
