  //---------------------------------------------------------------------------------------
  bmlfonDeleteGrid1Line() {
    this.mbChange = true;
    if (this.mArrVendorDebitGrid[this.miGrid1DeleteLineIndex].AddModify == 'A') {
      this.mArrVendorDebitGrid.splice(this.miGrid1DeleteLineIndex, 1);
      this.bmlfCalculateTotal();
    } else {
      let reqData = {
        JSON: JSON.stringify({
          DetailData: [{
            SOInvoice: this.mObjModel.SOInvoice,
            RowNo: this.mArrVendorDebitGrid[this.miGrid1DeleteLineIndex].SOLineNo
          }],
          ScreenName: [{
            CallType: this.msscreenName
          }],
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.mbIsLoading = true;
      this.objService.bmlfonDeleteLineARInvoice(reqData).subscribe(res => {
        this.mbIsLoading = false;
        if (res.Response[0].ErrorCode == "") {
          this.mArrVendorDebitGrid.splice(this.miGrid1DeleteLineIndex, 1);
          this.bmlfCalculateTotal();
        }
      });
    } // End Else
  }
