  bmlfonOpenTaxQtyPopup(psId, psTitle, piRowNo) {
    console.log('s this working');
    this.mArrTaxDataRow = [];
    // this.marrTaxGridData = [];
    this.msModaltitle = this.objUtils.bmgfonTranslate('ARINVOICE.TAXTOTAL');
    if (this.msAppTaxType == 'VAT') {
      if (this.mArrTaxData.length > 0) {
        //Row wise Filter 
        this.mArrTaxData.forEach(ele => {
          if (piRowNo.toString() == ele.DocLinNo.toString()) {
            this.mArrTaxDataRow.push(ele);
          }
        });
      }
      ;
      if (this.mArrTaxData.length > 0) {
        //set Decimal Precision
        this.mArrTaxData.forEach(ele => {
          ele.TaxAbleAmt = Number(ele.TaxAbleAmt).toFixed(6); //this.miQtyPrecision
          ele.TaxAmt = Number(ele.TaxAmt).toFixed(6); //this.miQtyPrecision
          ele.TaxRate = Number(ele.TaxRate).toFixed(2);
        });
      }
      ;
    }
    this.miTaxGridTotal = this.mArrTaxDataRow.reduce((prev, cur) => {
      let pstotal = Number(prev) + Number(cur['TaxAmt']);
      return this.objUtils.bmgfSetPrecision(pstotal);
    }, 0);
    this.modalservice.open(psId);
  }
