      this.mbChange = true;
      this.mObjModel[psInputDesKey] = pobjEvent.valueKey;
      this.msReceiptAcctDesc = pobjEvent.value.Description;
      this.msCashBankNameAct = pobjEvent.value.Name;
      this.mObjModel.BankCurrency = pobjEvent.value.CurrencyKey;
