  //Close
  bmlfonClose() {
    if (!this.mbChange && !this.FieldExtender.mbChange && !this.customCtrl.mbChange) {
      this.router.navigate(['/main/accountsreceivable/receipt-entry']);
    } else {
      this.mbShowDialog = true;
      this.msCallFor = "FormClose";
    }
  }
  //---------------------------------------------------------------------------------------
  bmlfonDialogAction(action) {
    if (action == 'No') {
      this.mbShowDialog = false;
      this.mbChange = false;
      if (this.msCallFor == "FormClose") {
        this.router.navigate(['/main/accountsreceivable/receipt-entry']);
      } else if (this.msCallFor == "Add") {
        this.bmlfonClearControl();
        this.mObjModel.Status = 'NEW';
        this.bmlfHandleControls('NEW');
      } else if (this.msCallFor == "Copy") {
        this.bmlfonSetFormMode("I", "Copy");
      } else if (this.msCallFor == "Search") {
        this.bmlfOpenLookupModal('ReceiptNoSearch', 'Receipt Entry', 'ReceiptEntryBOTHList', 'click', '', 'custom', 'txtReceiptNo');
      } else if (this.msCallFor == "Post") {
        this.bmlfGetDataOnLoad(this.mObjModel.ReceiptNo, this.mObjModel.Status);
      } else {
        return;
      }
    } // if no
    else if (action == 'Yes' && this.msCallFor == "FormClose") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Add") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Copy") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Search") {
      this.mbSearchAfterSave = true;
      this.mbShowDialog = false;
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Post") {
      this.mbShowDialog = false;
      this.mbChange = true;
      this.bmlfonSubmitData();
    } else if (action == 'Yes') {
      // call update function
      this.mbChange = false;
      this.mbShowDialog = false;
      this.msFormMode = "U";
      this.mbDisabledPrimaryKey = true;
    } else {
      this.mbShowDialog = false;
    }
    setTimeout(function () {
      document.getElementById('txtReceiptNo').focus();
    }, 10);
  }
  bmlfOnSearchValidation() {
    this.mbSearchAfterSave = false;
    this.bmlfOpenLookupModal('ReceiptNoSearch', 'Receipt Entry', 'ReceiptEntryBOTHList', 'click', '', 'custom', 'txtReceiptNo');
  }
  //---------------------------------------------------------------------------------------
  bmlfGetDataOnLoad(msReceiptNoKey, msStatus) {
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: [{
          ReceiptNo: msReceiptNoKey,
          Status: 'BOTH'
        }],
        Response: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.mbIsLoading = true;
    this.objService.bmlfonGetReceiptEntry(reqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res.HeaderData.length > 0) {
        this.msFormMode = "U";
        this.mbDisabledPrimaryKey = true;
        this.mObjModel = res.HeaderData[0];
        this.mbCustomControl = true;
        this.mObjModel.PostingDate = new Date(res.HeaderData[0].PostingDate);
        this.mObjModel.ReceiptDate = new Date(res.HeaderData[0].ReceiptDate);
        this.mObjModel.PaymentDocDate = new Date(res.HeaderData[0].PaymentDocDate);
        this.mObjModel.TotalAmount = Number(this.mObjModel.TotalAmount);
        this.mdtReversalDate = new Date(res.HeaderData[0].ReceiptDate);
        this.mObjModel.CurrConvDate = new Date(res.HeaderData[0].CurrConvDate);
        if (this.mObjModel.Currency_Key == this.mObjModel.BankCurrency) {
          this.mbCurrencyConversion = true;
        }
        if (res.BalanceData.length > 0) {
          //Bank Currency
          if (Number(res.BalanceData[0].RecpToBalanceBankCurrency) < 0) {
            this.msBankCurrencyBalance = this.mObjModel.Currency_Key + ' ' + Number(res.BalanceData[0].RecpToBalanceBankCurrency * -1).toFixed(this.miAmountPrecision) + ' Cr.';
          } else {
            this.msBankCurrencyBalance = this.mObjModel.Currency_Key + ' ' + Number(res.BalanceData[0].RecpToBalanceBankCurrency).toFixed(this.miAmountPrecision) + ' Dr.';
          }
          //Home Currency
          if (Number(res.BalanceData[0].RecpToBalanceHomeCurrency) < 0) {
            this.msHomeCurrencyBalance = this.msHomeCurrency + ' ' + Number(res.BalanceData[0].RecpToBalanceHomeCurrency * -1).toFixed(this.miAmountPrecision) + ' Cr.';
          } else {
            this.msHomeCurrencyBalance = this.msHomeCurrency + ' ' + Number(res.BalanceData[0].RecpToBalanceHomeCurrency).toFixed(this.miAmountPrecision) + ' Dr.';
          }
          if (this.msBankCurrencyBalance.length > 0 && this.msHomeCurrencyBalance.length > 0) {
            this.msHomeCurrencyBalance = this.msHomeCurrencyBalance + " | " + this.msBankCurrencyBalance;
          }
          //Customr/Vendor Home Currecny    
          // if (Number(res.BalanceData[0].RecpFromBalance) < 0) {
          //   this.msCurrencyBalance = this.msHomeCurrency + ' ' + Number(res.BalanceData[0].RecpFromBalance * -1).toFixed(this.miAmountPrecision) + ' Cr.';
          // } else {
          //   this.msCurrencyBalance = this.msHomeCurrency + ' ' + Number(res.BalanceData[0].RecpFromBalance).toFixed(this.miAmountPrecision) + ' Dr.';
          // }
          this.bmlfGetCustomerVendorBalance('AR'); // 28/dec/2020 deepak porwal scr no.145595
        }

        if (res.DetailData.length > 0) {
          let parrGridData = res.DetailData;
          parrGridData.forEach(ele => {
            ele.DueDate = new Date(ele.DueDate);
            ele.Flag = 'M';
          });
          this.mArrPaymentEntryGrid = parrGridData; //res.DetailData;
          let rowIndex = 0;
          this.mArrPaymentEntryGrid.forEach(ele => {
            this.bmlfonRefTypeOnChangesFn('', rowIndex, true);
            rowIndex = rowIndex + 1;
          });
        }
        this.bmlfHandleControls(this.mObjModel.Status); //Disable Enable on Status
        this.bmlfCalculateTotal();
        this.bmlfGetBankAccountDetail(this.mObjModel.ReceiptAcct);
        this.bmlfGetLookupDes(this.mObjModel);
        // this.bmlfonPaymentTypeChange(true);
        this.bmlfonVendMiscType();
        this.mbChange = false;
        this.bmlfCheckEsignApplicableOnForm();
        setTimeout(function () {
          document.getElementById('dtReceiptDate').focus();
        }, 10);
      } else {
        this.msFormMode = "I";
        this.mbDisabledPrimaryKey = false;
      }
      if (this.msCopyRecord == "Y") {
        this.msFormMode = "I";
        this.mObjModel.ReceiptNo = ""; // clear the primary key
        this.mbDisabledPrimaryKey = false;
        if (this.mObjModel.PaymentType == 'D') {
          //16/05/2023
          this.mObjModel.PaymentDocNo = '';
        }
        this.mbChange = false;
        this.bmlfonSetFormMode("I", "Copy");
        //scr 147586
        //setTimeout(function () { document.getElementById('txtReceiptNo').focus(); }, 10);
      }
    });

    this.bmlfonURL(msReceiptNoKey, msStatus);
  }
