  //---------------------------------------------------------------------------------------
  // Get Lookup Description
  bmlfGetLookupDes(pobjData) {
    let pKeyCode;
    if (this.mObjModel.CustVendMisType == 1) {
      // Vendor
      pKeyCode = 'VENDKEY';
    } else if (this.mObjModel.CustVendMisType == 0) {
      //Customer
      pKeyCode = 'CUSTKEY';
    } else if (this.mObjModel.CustVendMisType == 2) {
      //Miscellaneous
      pKeyCode = 'ACCOUNT';
    }
    let parrSetKeyData = [{
      KeyCode: pKeyCode,
      KeyValue1: pobjData.Customer,
      KeyValue2: '',
      KeyDescription: ''
    }];
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: parrSetKeyData,
        ScreenName: [{
          ScreenName: this.msscreenName
        }],
        Response: [{
          ResponseText: '',
          ErrorCode: ''
        }]
      })
    };
    this.userService.bmlfFetchKeyDescription(reqData).subscribe(res => {
      if (res == null) {
        return false;
      }
      if (res.LookupData.length) {
        res.LookupData.forEach(ele => {
          if (ele.KeyCode == 'CUSTKEY' || ele.KeyCode == 'VENDKEY' || ele.KeyCode == 'ACCOUNT') {
            this.msCustomerName = ele.KeyDescription;
          }
        });
      }
    }, err => {
      console.log(err);
    });
  }
  bmlfGetDefaultSeries() {
    let pobjReqData = {
      ScreenName: 'VendorDebitNoteComponent',
      LookUpKey: 'VendorDebitNoteSeries',
      Filter1: 'Receipt Entry',
      Filter2: this.msRecUserID
    };
    this.userService.GETGeneralSqlData(pobjReqData).subscribe(res => {
      if (res.LookupData.length > 0) {
        this.mObjModel.ReceiptNo = res.LookupData[0].DefaultSeries;
        this.mbChange = false;
        setTimeout(function () {
          document.getElementById('dtReceiptDate').focus();
        }, 10);
      } else {
        //scr 147586
        setTimeout(function () {
          document.getElementById('txtReceiptNo').focus();
        }, 10);
      }
    });
  }
