  bmlfGetCustomerVendorBalance(psARAP) {
    var DATE;
    if (this.mObjModel.ReceiptDate == null) {
      DATE = null;
    } else {
      DATE = this.mObjModel.ReceiptDate;
    }
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: [{
          CustVendKey: this.mObjModel.Customer,
          ARAP: psARAP,
          DATE: DATE,
          Balance: Number(0).toFixed(this.miAmountPrecision)
        }],
        Response: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.mbIsLoading = true;
    this.objService.GetCustomerVendorBalance(reqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res.Response[0].ErrorCode == "") {
        if (Number(res.HeaderData[0].Balance) < 0) {
          this.msCurrencyBalance = this.mObjModel.Currency_Key + ' ' + Number(res.HeaderData[0].Balance * -1).toFixed(this.miAmountPrecision) + ' Cr.';
        } else {
          this.msCurrencyBalance = this.mObjModel.Currency_Key + ' ' + Number(res.HeaderData[0].Balance).toFixed(this.miAmountPrecision) + ' Dr.';
        }
      } else {}
    });
  }
