  fillControlFromParam(resData) {
    resData.forEach(element => {
      let key = this.bmlfongetKeyFromValue(element.CONTROLNAME);
      this.mobjData[key] = element.CONTROLVALUE;
      if (key == 'HomeCurrency' && element.CONTROLVALUE == 'True') {
        this.mobjData.Currency = 'H';
      }
      if (key == 'CustomerCurrency' && element.CONTROLVALUE == 'True') {
        this.mobjData.Currency = 'V';
      }
      // if (key=='AsOnDate' && element.CONTROLNAME=='PVToDate3' ){
      //   this.mobjData.AsOnDate=new Date(element.CONTROLVALUE);
      // }
    });

    if (this.mobjData.AsOnDate == '30/Dec/1899') {
      this.mobjData.AsOnDate = null;
    } else {
      this.mobjData.AsOnDate = new Date(this.mobjData.AsOnDate);
    }
    this.bmlfGetDescription(this.mobjData);
    this.mbIsLoading = false;
  }
